."},{"date":"1762-02-11","tags_section":"Es wird zum Verkauf angetragen:","text":"12. Bey Meister Daniel Pfister im Doctor-Garten sind schöne Ranunkeln-Wurzen und auch Gold-Lilien oder Narcissus Indicus Jacobeus in billigem Preis zu haben."},{"date":"1762-02-11","tags_section":"Es wird zum Verkauf angetragen:","text":"13. Ein modenfarbes tuchenes Kleid in billigem Preis, im Berichthaus zu erfragen."},{"date":"1762-02-11","tags_section":"Es wird zum Verkauf angetragen:","text":"14. Bey schönem Wetter eingesammeltes Heu und dito Emdt vom vorigen Jahr, in billigem Preis, im Berichthaus zu erfragen."},{"date":"1762-02-11","tags_section":"Es wird zum Verkauf angetragen:","text":"15. Wo folgende Bücher zu haben, ist im Berichthaus zu erfragen: Münsters Cosmographie, Brandes allgemeine Chronica, Hedionis Kirchenhistorie, Josephi Jüdische Geschichten, Sleidani Historie, alles wohl gebunden, im Berichthaus zu erfragen."},{"date":"1762-02-11","tags_section":"Es wird zum Verkauf angetragen:","text":"16. Bey"}]}}
